using BenchmarkDotNet.Attributes;
using ResizeImage.API.Controllers;

namespace ResizeImage.Benchmark;

[Config(typeof(BenchmarkConfig))]
public class ResizeBenchmark
{
    #region Fields

    private readonly ImageSharpController _imageSharpController = new(); 
    private readonly SkiaSharpController _skiaSharpController = new(); 
    private readonly SystemDrawingController _systemDrawingController = new();

    #endregion

    #region Properties

    [Params(1280)] public int Width;
    [Params(720)] public int Height;

    #endregion

    #region Constants

    private const string ImageBase64Encoded = "";

    #endregion

    [Benchmark]
    public void ResizeImageSharp()
    {
        var res = _imageSharpController.ResizeImage(Width, Height, ImageBase64Encoded)
            .GetAwaiter().GetResult();
    }

    [Benchmark]
    public void ResizeSkiaSharp()
    {
        var res = _skiaSharpController.ResizeImage(Width, Height, ImageBase64Encoded)
            .GetAwaiter().GetResult();
    }

    [Benchmark]
    public void ResizeSystemDrawning()
    {
        var res = _systemDrawingController.ResizeImage(Width, Height, ImageBase64Encoded)
            .GetAwaiter().GetResult();
    }
}